import React from "react";
import styled from "styled-components";
import { LIElement, LinkContainer, ULElement } from "../Header/style";
import Logo from "../Logo/index";

const HeaderContainer = styled.header`
  width: 100%;
  height: 100%;
`;

const NavContainer = styled.div`
  display: flex;
  padding: 17px;
  display: flex;
  align-items: center;
  box-shadow: 0 2px 5px 0 rgba(175, 175, 175, 0.3);
`;

const LOGOContainer = styled.div`
  width: 125px;
  height: 100%;
`;

const ListContainer = styled.div`
  margin-left: 10%;
`;

function Index() {
  return (
    <>
      <HeaderContainer>
        <NavContainer>
          <Logo />
          <ListContainer>
            <ULElement>
              <LinkContainer to="admin/user">
                <LIElement padding>Home</LIElement>
              </LinkContainer>
              <LIElement padding>
                <LinkContainer to="">Pages</LinkContainer>
              </LIElement>
              <LIElement padding>
                <LinkContainer to="">Destinations</LinkContainer>
              </LIElement>
              <LIElement padding>
                <LinkContainer to="">Blog</LinkContainer>
              </LIElement>
              <LIElement padding>
                <LinkContainer to="">Shop</LinkContainer>
              </LIElement>
              <LIElement padding>
                <LinkContainer to="">Element</LinkContainer>
              </LIElement>
            </ULElement>
          </ListContainer>
        </NavContainer>
      </HeaderContainer>
    </>
  );
}

export default Index;
